	add("miracle", "{\"term\":\"miracle\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) {{m|fro|miracle}}, from Latin {{m|la|mīrāculum||object of wonder}}, from {{m|la|mīror||to wonder at}}, from {{m|la|mīrus||wonderful}}, from Proto-indo-european {{m|ine-pro|*smei-}}, {{m|ine-pro|*mei-||to smile, to be astonished}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A wonderful event occurring in the physical world attributed to supernatural powers\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Many religious beliefs are based on \u0027\u0027miracles\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An example of a \u0027\u0027miracle\u0027\u0027 associated with Muhammad is the splitting of the moon\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A fortunate outcome that prevails despite overwhelming odds against it\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1966\u0027\u0027 November 25, \u0026quot;A Great Document Made by Wisdom and Luck\u0026quot;, in \u0027Life\u0027, volume 61, number 22, page 13\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Secondly, it was a \u0027\u0027miracle\u0027\u0027 that a document hammered out with such difficulty, satisfying very few of its authors completely and satisfying some of them very little, would turn out to be the most successful political invention in history\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1993\u0027\u0027, Hatch N. Gardner and Frank H. Winter, \u0027P-51 Mustang\u0027 (Turner Publishing Company), page 78\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"It was a \u0027\u0027miracle\u0027\u0027 that I survived that ditching in the high waves because I had my seat belt and shoulder harness unbuckled in anticipation of bailing out\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Eric Lionel Jones, \u0027The European miracle: environments, economies, and geopolitics in the history of Europe and Asia\u0027 (Cambridge University Press), page 218\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Seen in this light it was a \u0027\u0027miracle\u0027\u0027 of economic history that Europe was able to undertake so much higher a proportion of its expansion overseas, and secure a massive injection of resources and big markets without a commensurate growth in her numbers\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"An awesome and exceptional example of somethin\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"1847\u0027\u0027, Honoré de Balzac, \u0027Scenes from a Courtesan\u0027s Life\u0027, page 323\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"The home of our kings, over which you tread as you pace the immense hall known as the Salle des Pas-Perdus, was a \u0027\u0027miracle\u0027\u0027 of architecture\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Joseph R. Conlin, \u0027The American Past: A Survey of American History\u0027 (Cengage Learning), page 670\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"It was a \u0027\u0027miracle\u0027\u0027 of engineering that made possible, with the cheap electricity the dam generated, another kind of \u0027\u0027miracle\u0027\u0027: the bizarre, superilluminated city of Las Vegas, Nevada\", \"priority\":15}]}, \"synonyms\":{}}");

