	add("mirth", "{\"term\":\"mirth\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\"], \"text\":\"Old english (ca. 450-1100) {{m|ang|sc\u003dLatinx|myrġþ}}, approximately equivalent to {{suffix|merry|th|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The emotion usually following humour and accompanied by laughter; merriment; jollity; gaiety\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1883\u0027\u0027, w:Robert Louis Robert Louis Stevenson, \u0027w:Treasure Treasure Island\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"And he began to laugh again, and that so heartily, that, though I did not see the joke as he did, I was again obliged to join him in his \u0027\u0027mirth\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"title\u003dThe Mirror and the chapter\u003d2|url\u003dhttp://openlibrary.org/works/OL1097634W|passage\u003dShe was a fat, round little woman, richly apparelled in velvet and lace, […]; and the way she laughed, cackling like a hen, the way she talked to the waiters and the maid,\u0026amp;nbsp;[…]\u0026amp;mdash;all these unexpected phenomena impelled one to hysterical \u0027\u0027mirth\u0027\u0027, and made one class her with such immortally ludicrous types as Ally Sloper, the Widow Twankey, or Miss Moucher\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1912\u0027\u0027, w:Willa Willa Cather, \u0027w:The Bohemian Girl (short The Bohemian Girl\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Their eyes met and they began to laugh. They laughed as children do when they cannot contain themselves, and can not explain the cause of their \u0027\u0027mirth\u0027\u0027 to grown people, but share it perfectly together\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"That which causes merriment\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1922\u0027\u0027, w:James James Joyce, \u0027w:Ulysses Ulysse\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Phantasmal \u0027\u0027mirth\u0027\u0027, folded away: muskperfumed\", \"priority\":9}]}, \"synonyms\":{}}");

